import React from 'react';
import './ScoreBoard.css';

const ScoreBoard = () => {
  return (
    <div className="scoreboard-container">
      <h2>Score Board</h2>
      <p>Scoreboard feature coming soon!</p>
    </div>
  );
};

export default ScoreBoard;
